import React , {useState} from "react";
import "./NewExpense.css";
 const NewEXpenseForm = () =>{
   const inputVal = (e)=>{
    const [input , setInput]= useState(e.target.value);
      setInput("taha");
       console.log(input);
   }
      return (
     <form>
       <div className="new-expense__contorls">
         <div className="new-expene__control">
           <label>Title</label>
           <input type='text' onChange={inputVal}/>
         </div>
         <div className="new-expene__control">
           <label>Amount</label>
           <input type='number' min="0.01" step="0.01" onChange={inputVal}/>
         </div>
         <div className="new-expene__control">
           <label>date</label>
           <input type='date' min="2019-01-01" max="3024-12-31" onChange={inputVal}/>
         </div>
         <div className="new-expense__actions">
           <button>  Add Expense  </button>
         </div>
       </div>



     </form>
   )
 }
 export default NewEXpenseForm;
